export default class InputSelect extends Component {
  render() {
    const { label, options, id, dataTest } = this.props;

    return (
      <label htmlFor={ id }>
        { label }
        <select
          id={ id }
          data-testid={ dataTest }
        >
          console.log(options)
          <option value="normal">
            normal
          </option>
          <option value="normal">
            raro
          </option>
          <option value="normal">
            muito raro
          </option>
        </select>
      </label>
    );
  }
}
